import{_ as a,o as t,c as e,N as o}from"./chunks/framework.7e203a6d.js";const m=JSON.parse('{"title":"Getting started with GazePlotter","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"upload-data/index.md"}'),r={name:"upload-data/index.md"},i=o('<h1 id="getting-started-with-gazeplotter" tabindex="-1">Getting started with GazePlotter <a class="header-anchor" href="#getting-started-with-gazeplotter" aria-label="Permalink to &quot;Getting started with GazePlotter&quot;">​</a></h1><p>GazePlotter is a web application for visualizing gaze data from eye-tracking software. It uses interactive scarf plots (or sequence charts) which are built automatically from the data without any manual configuration and data transformation.</p><p>The workplace is designed to be easy to use and to provide a quick overview of the data. The workplace is available at <a href="https://gazeplotter.com" target="_blank" rel="noreferrer">gazeplotter.com</a>.</p><h2 id="start-demo-visualization" tabindex="-1">Start demo visualization <a class="header-anchor" href="#start-demo-visualization" aria-label="Permalink to &quot;Start demo visualization&quot;">​</a></h2><p>For a quick start of the GazePlotter workplace, you can hit the <code>Try demo data</code> button on the <a href="https://gazeplotter.com" target="_blank" rel="noreferrer">GazePlotter app</a>. This will start a scarf chart visualization of a sample data file.</p><h2 id="upload-your-own-data" tabindex="-1">Upload your own data <a class="header-anchor" href="#upload-your-own-data" aria-label="Permalink to &quot;Upload your own data&quot;">​</a></h2><p>You can upload your own data files to the GazePlotter workplace. The workplace will automatically detect the file type and start a visualization of the data. The workplace supports the following file types:</p><ul><li><a href="./tobii-pro-lab.html">Tobii Pro Lab</a></li><li><a href="./ogama.html">OGAMA</a></li><li><a href="./gazepoint.html">GazePoint</a></li><li><a href="./smi-begaze.html">SMI BeGaze</a></li></ul>',8),l=[i];function n(s,d,h,c,p,u){return t(),e("div",null,l)}const _=a(r,[["render",n]]);export{m as __pageData,_ as default};
